INSERT INTO `rdmCardinalRules` VALUES (1,'1.	Приступать к выполнению работ, только если известен порядок их безопасного выполнения.'),(2,'2.	Незамедлительно реагировать на нарушения данных кардинальных правил и опасные действия работников, останавливая эти опасные д'),(3,'3.	Использовать все предусмотренные средства индивидуальной защиты и средства спасения на территории предприятия, в производстве'),(4,'4.	Пристегиваться ремнями безопасности (если они установлены/должны быть установлены) в движущемся автотранспорте. Управлять авт'),(5,'5.	Запрещается появляться на работе в состоянии алкогольного, наркотического или иного токсического опьянения, употреблять или п'),(6,'6.	Запрещается пользоваться сотовыми телефонами и аудиоплеерами во время управления транспортом или оборудованием.'),(7,'7.	Запрещается скрывать информацию о нарушениях настоящих правил и происшествиях, а также искажать или представлять ложную инфор');
